-- ----------------------------
-- Table structure for `sys_role`
-- ----------------------------
DROP TABLE IF EXISTS `sys_role`;
CREATE TABLE `sys_role` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `office_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '',
  `enname` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `role_type` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `data_scope` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `is_sys` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `useable` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `create_date` datetime NOT NULL COMMENT '',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `update_date` datetime NOT NULL COMMENT '',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '',
  PRIMARY KEY (`id`),
  KEY `sys_role_del_flag` (`del_flag`),
  KEY `sys_role_enname` (`enname`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='';

