-- ----------------------------
-- Table structure for `sys_user`
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `company_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `office_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `login_name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '',
  `password` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '',
  `no` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '',
  `email` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `phone` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `mobile` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `user_type` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `photo` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `login_ip` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'IP',
  `login_date` datetime DEFAULT NULL COMMENT '',
  `login_flag` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `create_date` datetime NOT NULL COMMENT '',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `update_date` datetime NOT NULL COMMENT '',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '',
  PRIMARY KEY (`id`),
  KEY `sys_user_office_id` (`office_id`),
  KEY `sys_user_login_name` (`login_name`),
  KEY `sys_user_company_id` (`company_id`),
  KEY `sys_user_update_date` (`update_date`),
  KEY `sys_user_del_flag` (`del_flag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='';

